import Button from "../elements/Button";

const Buttons = ({ whichStep, setWhichStep }) => {
  return (
    <>
      <Button
        {...{ buttonText: "Previous", setWhichStep: whichStep + 1 }}
      />
      <Button {...{ whichStep, setWhichStep, buttonText: "Next" }} />
    </>
  );
};

export default Buttons;
